class Solution(object):

    @classmethod
    def is_valid(cls, x):
        if x == 0:
            return False
        while x &1 == 0:
            x = x >> 1
        return x == 1

    def countPairs(self, deliciousness):
        """
        :type deliciousness: List[int]

        :rtype: int

        """

        items_cnt = {}
        for _x in deliciousness:
            if _x in items_cnt:
                items_cnt[_x] += 1
            else:
                items_cnt[_x] = 1
        uniquey_items = sorted([_x for _x in items_cnt.keys()])

        cnt = len(uniquey_items)
        res_cnt = 0
        max_num = uniquey_items[-1] * 2
        obj_num = 1
        while obj_num <= max_num:
            checked_x = set()
            for idx, x in enumerate(uniquey_items):
                target_num = obj_num - x
                if target_num < x:
                    break
                elif target_num == x:
                    res_cnt += int((items_cnt[x] * items_cnt[x] - items_cnt[x])/2)
                else:
                    res_cnt += items_cnt.get(target_num, 0) * items_cnt[x]

            obj_num = obj_num << 1
        return res_cnt % 1000000007
